  useEffect(() => {

    fetch('http://[::1]:3000/artworks')
      .then(r => r.json())
      .then(artwork => setArtworks(artwork))
    }, [])  

    console.log(artworks)

  return (
    <div className="App">
      <Route path='/'>
        <Login />
